<x-feature>
    <x-slot name="title">
        Company Title & Transfer Conveyancing
    </x-slot>
    <x-slot name="body">
        <x-p>We handle both strata and off the plan company titles by reviewing
            company agreements, auditing the memorandum of articles, and investigating reports provided
            by the managing agent of the property.
        </x-p>
        <x-p>We also facilitate property and land transfers between family members
            or executors, communicating with NSW Land Registry Services and submitting the appropriate
            documents on your behalf.
        </x-p>
    </x-slot>
